from typing import DefaultDict

from collections import defaultdict

def def_value():
    return 0

def MaxMers(seq,k):
    dct=defaultdict(def_value)
    for i in range(0,len(seq)-k+1):
        dct[seq[i:int(i+k)]]+=1

    mx = max(dct.values())
    lst = [k for k,v in dct.items() if (v) == mx]
    lst.sort()
    return " ".join(lst)

